from collections import defaultdict
def a(n, nums_so_far = []):
    best = len(nums_so_far)
    for candidate in range(1 if nums_so_far == [] else nums_so_far[-1] + 1, n + 1):
        counts = defaultdict(int)
        new_nums = nums_so_far + [candidate]
        for ind, val_1 in enumerate(new_nums):
            for val_2 in new_nums[ind:]:
                counts[val_1 + val_2] += 1
        if sum(1 for value in counts.values() if value > 1) <= 1:
            best = max(best, a(n, new_nums))
    return best
